const resumeData = {
  name: "Your Name",
  role: "Full Stack Developer",
  roleDescription: "I create beautiful and functional web applications",
  socialLinks: [
    {
      name: "github",
      url: "https://github.com/yourusername",
      className: "fab fa-github",
    },
    {
      name: "linkedin",
      url: "https://linkedin.com/in/yourusername",
      className: "fab fa-linkedin",
    },
  ],
  aboutme:
    "I am a passionate full-stack developer with expertise in modern web technologies. I love creating efficient, scalable, and user-friendly applications.",
  address: "Your Location",
  email: "your.email@example.com",
  phone: "+1 234 567 8900",
  education: [
    {
      UniversityName: "Your University",
      specialization: "Computer Science",
      MonthOfPassing: "June",
      YearOfPassing: "2020",
    },
  ],
  skills: [
    { name: "HTML5 & CSS3", level: 90 },
    { name: "JavaScript", level: 85 },
    { name: "React", level: 80 },
    { name: "Node.js", level: 75 },
    { name: "Python", level: 70 },
    { name: "SQL", level: 75 },
  ],
  portfolio: [
    {
      name: "Project One",
      description: "A brief description of project one",
      imgUrl: "https://via.placeholder.com/300",
      url: "https://example.com",
      github: "https://github.com",
      technologies: ["React", "Node.js", "MongoDB"],
    },
    // Add more projects as needed
  ],
};

export default resumeData;
